              <div className={styles.text}>Caption Text</div>
            </div> */}
          </div>
          <div className={styles.navButtonSection}>
            <div className={styles.navButton}>
              BUILD VISUAL PROFILE<div className={styles.innerTriangle}></div>
            </div>
            <div className={styles.navButton}>
              LOOK FOR APT GUIDANCE<div className={styles.innerTriangle}></div>
            </div>
            <div className={styles.navButton}>
              FIND INTERESTING EVENTS
              <div className={styles.innerTriangle}></div>
            </div>
            <div className={styles.navButton}>
              FEATURED STORIES<div className={styles.innerTriangle}></div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
